webpackJsonp([0x6ac34a94d70b],{440:function(a,t){a.exports={data:{site:{siteMetadata:{title:"Blog by J.Spin",subtitle:"ComputerVision / MachineLearning / Android(Java) / ReactJS / NodeJS",copyright:"© All rights reserved.",author:{name:"제이스핀 (J.Spin)",instagram:"paeng___"},disqusShortname:"",url:"https://lumen.netlify.com"}},markdownRemark:{id:"/Users/paeng/dev/web/nuggy875.github.io/src/pages/articles/2018-07-21---Django REST Framework 시작하기/index.md absPath of file >>> MarkdownRemark",html:'<p>Django에는 REST API를 만들 수 있는 <em>Django REST framework</em> 가 존재한다. <a href="http://www.django-rest-framework.org/tutorial/quickstart/">Django REST framework Quickstart</a>에서는 Django tutorial과 다른 디렉토리 구조를 사용하고 django에 기본적으로 내장 되어있는 User, Group 에 대한 예제를 다룬다.<br>\n이 포스트에서는 Django tutorial에서 사용하는 디렉토리 구조를 사용하고 새로운 앱과 모델을 생성하여 REST API를 생성하는 방법에 대해 작성하였다.  </p>\n<h2>프로젝트 설정</h2>\n<p>프로젝트를 실행할 Root 디렉토리를 생성하자. 이름은 맘대로\n<code class="language-text">$ mkdir django-rest-tutorial\n$ cd django-rest-tutorial</code></p>\n<p><em>django</em> 와 <em>djangorestframework</em> 를 pip로 설치한다.\n<code class="language-text">$ pip install django\n$ pip install djangorestframework</code>\n프로젝트와 앱을 생성한다.\n프로젝트 이름은 <em>tutorial</em> , 앱이름은 <em>myapp</em> 이라고 하겠다.</p>',fields:{tagSlugs:["/tags/django/","/tags/rest-api/","/tags/python/","/tags/장고/"]},frontmatter:{title:"[장고] Django REST API 시작하기",tags:["django","REST API","Python","장고"],date:"2018-07-17T03:24:32.169Z",description:"Django REST API 시작하여 간단한 웹 서비스 시작하기"}}},pathContext:{slug:"/posts/django/post-1"}}}});
